import React from "react";
import { Jumbotron, Container } from "react-bootstrap";

export default function Home() {
  return (
    <Jumbotron fluid>
      <Container>
        <h1>Bing Shop</h1>
        <p>This is a simple e-commerce website created by Bing.</p>
        <p>You can browse products, view details and add them to your cart.</p>
        <p>You can also create an account and edit your profile.</p>
      </Container>
    </Jumbotron>
  );
}
